import base64
import re

def get_image(): 

    image2="(data:image/png;base64,)"

    image1="(data:image/png;base64,)"
    
    
    return remove_base64_prefix((image1)) # should return the base64 string without the prefix

# remove initial parte of the string base64
def remove_base64_prefix(base64_string):
    # Extrair o que tem dentro de (data:image/png;base64,XXXXX) 
    # Lembrese de o ) no final deve ser retirado
    # Retornar apenas o XXXXX
    return re.search(r"(?<=data:image/png;base64,).*(?=\))", base64_string).group(0)
    


if __name__ == '__main__':
    print(get_image()) # should return the base64 string without the prefix